import { useSignIn } from '@clerk/clerk-react';
import React from 'react';

export default function LogInButton() {
    const { signIn, isLoaded } = useSignIn();
    if (!isLoaded) {
        return null;
    }

    return (
        <>
            <div>
                <button>Log in</button>;
            </div>
        </>
    );
}
